                  <h3>Information</h3>
                  <div class="info_data">
                      <div class="data">
                          <h4>Email</h4>
                          <p>alex@gmail.com</p>
                      </div>
                      <div class="data">
                        <h4>Phone</h4>
                          <p>0001-213-998761</p>
                    </div>
                  </div>
              </div>

            <div class="projects">
